##Week over Week Retention Cohort Analysis

use mohitdb
CREATE TABLE Q1(
  id INT PRIMARY KEY,
  userid INT,
  total INT,
  Created DATE);
  

  select * from Q1
  
  WITH cte1 AS 
  (SELECT id,userid,total,created,week(created) weeknum,
   MIN(created)OVER(PARTITION by week(created) order by created) as Weekstartingdate 
   from Q1
  WHERE created>='2017-03-06'
  order by created),
  
  cte2 as 
  (SELECT Weekstartingdate,weeknum,userid
   from cte1),
   
   cte3 as 
   (select Weekstartingdate as Weekstartingdate1 , weeknum as weeknum1,userid as userid1
    from cte1)
    
    select Weekstartingdate,
    count(DISTINCT case when weeknum1-weeknum = 0 THEN userid end) as Week0,
    count(DISTINCT case when weeknum1-weeknum = 1 THEN userid end) as Week1,
    count(DISTINCT case when weeknum1-weeknum = 2 THEN userid end) as Week2,
    count(DISTINCT case when weeknum1-weeknum = 3 THEN userid end) as Week3,
    count(DISTINCT case when weeknum1-weeknum = 4 THEN userid end) as Week4,
    count(DISTINCT case when weeknum1-weeknum = 5 THEN userid end) as Week5,
    count(DISTINCT case when weeknum1-weeknum = 6 THEN userid end) as Week6,
    count(DISTINCT case when weeknum1-weeknum = 7 THEN userid end) as Week7,
    count(DISTINCT case when weeknum1-weeknum = 8 THEN userid end) as Week8,
    count(DISTINCT case when weeknum1-weeknum = 9 THEN userid end) as Week9,
    count(DISTINCT case when weeknum1-weeknum = 10 THEN userid end) as Week10
    
    from cte2 left join cte3 on cte2.userid=cte3.userid1 and cte3.weeknum1>=cte2.weeknum
    GROUP by 1
    order by 1
    